import React from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardContent from '@material-ui/core/CardContent';
import Typography from '@material-ui/core/Typography';
import AutoComplete from './AutoComplete.js';
import List from './list.js';
const styles = theme => ({
  card: {
    display: '',
    width: 650,
    margin:25,
    height: 800,
  },
  details: {
    display: 'flex',
    flexDirection: '',
  },
  content: {
    flex: '',
  },
  cover: {
    width: 10,
  },
  controls: {
    display: 'flex',
    alignItems: 'center',
    paddingLeft: theme.spacing.unit,
    paddingBottom: theme.spacing.unit,
  },
});

class CardCase6 extends React.Component {
  constructor(props){
    super(props)
    this.state = {
      value : null,
      m1: this.props.foo,
      x: this.props.foo1,
      index : null,
      titleList: []
    }
    console.log(props.foo1);
  }

  static getDerivedStateFromProps(nextProps, prevState) {
    if (prevState.x !== nextProps.foo1) {
      return {
        x: nextProps.foo1
      };
    }
    // Return null if the state hasn't changed
    return null;
 }

  onSubmit = (value) => {
    this.setState({value})
  }

  onSubmitUrl = (value2) => {
    this.setState({value2})
  }

  onSubmitIndex = (index) => {
    this.setState({index})
  }

  createTitleList = () => {
    const { x, titleList } = this.state;
    for( let key in x)
    {
      const title = x[key].title;
      titleList.push(<p>{title}</p>)
      this.setState({titleList})
    }
    //console.log(titleList);
    return titleList
  }

  printMessage = () => {
    const {index, titleList} = this.state;
    if(index != null){
    return titleList[index].message
    }
    return null
  }

  printUrl = () =>{
    const {index} = this.state;
    if(index != null){
    return titleList[index].url
    }
    return null

  }
  render(){
  const { classes, theme, foo1} = this.props;
  console.log(this.props.foo1)
  return (
    <Card className={classes.card}>
      <div className={classes.details}>
        <CardContent className={classes.content}>
        <List foo1={this.createTitleList()} onSubmitIndex={this.onSubmitIndex} />
        <Typography component="h15" variant="h15">
            <div className="container_4">
              <p>Results</p>
              <div id="scroll">{this.printMessage()}</div>
              <p>Url:</p>
              <div className="c4"><a href={this.printUrl()}>{this.printUrl()}</a></div>
            </div>
        </Typography>
        </CardContent>
      </div>
    </Card>
  );
  }
}

CardCase6.propTypes = {
  classes: PropTypes.object.isRequired,
  theme: PropTypes.object.isRequired,
};

export default withStyles(styles, { withTheme: true })(CardCase6);
